import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

import MyNav from './components/MyNav'
import Footer from './components/Footer';


function App() {
  return (
    <div className="App">
      <MyNav brand={"EpiBooks"} link1={"Home"} link2={"Browse"} link3={"About"} />

      <Footer className={"bg-danger"}/>
    </div>
  );
}

export default App;
